namespace Armstrong1992\ZplImageToolBox\Tests\Unit\Finder;

use Armstrong1992\ZplImageToolBox\ImageData\Collection\EncodedImageDataCollection;
use Armstrong1992\ZplImageToolBox\ImageData\EncodedImageData;
use Armstrong1992\ZplImageToolBox\ImageData\Finder\Exception\ImageDataFinderException;
use Armstrong1992\ZplImageToolBox\ImageData\Finder\GfaFinder;
use Armstrong1992\ZplImageToolBox\Tests\TestUtils;
use PHPUnit\Framework\Attributes\CoversClass;
use PHPUnit\Framework\Attributes\DataProvider;
use PHPUnit\Framework\TestCase;

#[CoversClass(GfaFinder::class)]
final class GfaFinderTest extends TestCase
{
    #[DataProvider('provideTestSupportsData')]
    public function testSupports(mixed $data, bool $expectedResult): void
    {
        $this->assertEquals($expectedResult, $this->getGfaFinder()->supports($data));
    }

    public function testPassedNonStringData(): void
    {
        $this->expectException(ImageDataFinderException::class);
        $this->expectExceptionMessage('Passed data is not supported by this finder.');

        $this->getGfaFinder()->findInData(false);
    }

    #[DataProvider('provideTestFindInDataData')]
    public function testFindInData(string $labelFilename, EncodedImageDataCollection $expectedReturn): void
    {
        $this->assertEquals($expectedReturn, $this->getGfaFinder()->findInData(TestUtils::getTestLabel($labelFilename)));
    }

    public function testProvideEmptyLabel(): void
    {
        $this->assertCount(0, $this->getGfaFinder()->findInData(''));
    }

    private function getGfaFinder(): GfaFinder
    {
        return new GfaFinder();
    }

    public static function provideTestSupportsData(): \Generator
    {
        yield [true, false];
        yield [1, false];
        yield [1.0, false];
        yield [new \stdClass(), false];
        yield [fopen('php://temp', 'rb+'), false];
        yield ['', true];
        yield ['asd', true];
    }

    public static function provideTestFindInDataData(): \Generator
    {
        yield [
            'z64.lbl',
            self::createExpectedResult(
                self::createEncodedImageData(
                    ':Z64:',
                    35770,
                    70
                )
            ),
        ];
        yield [
            'z64_multiple.lbl',
            self::createExpectedResult(
                self::createEncodedImageData(
                    ':Z64:',
                    35770,
                    70
                ),
                self::createEncodedImageData(
                    ':Z64:',
                    37518,
                    78
                )
            ),
        ];
        yield [
            'zpl_compressed.lbl',
            self::createExpectedResult(
                self::createEncodedImageData(
                    '::::lS02L0lS07L0lS0F808I0lS07L0lM02KAFAK0lM017HF7HFDK0lM0NFE8I0lL01NFCJ0lL03FKAFHAJ0lL03DK07L0lL0BE80808F808I0lL07CK07L0lL0B8K078K0lL07L07L0lL0B8K0F8K0lL07L07L0lL038K078K0lL01L05L0lL0A8K0A8K0m0::::::::::::::::::::::::::::::::::::::::::::::::::',
                    35770,
                    70
                )
            ),
        ];
        yield [
            'zpl_compressed_multiple.lbl',
            self::createExpectedResult(
                self::createEncodedImageData(
                    '::::lS02L0lS07L0lS0F808I0lS07L0lM02KAFAK0lM017HF7HFDK0lM0NFE8I0lL01NFCJ0lL03FKAFHAJ0lL03DK07L0lL0BE80808F808I0lL07CK07L0lL0B8K078K0lL07L07L0lL0B8K0F8K0lL07L07L0lL038K078K0lL01L05L0lL0A8K0A8K0m0::::::::::::::::::::::::::::::::::::::::::::::::::',
                    35770,
                    70
                ),
                self::createEncodedImageData(
                    '::::::',
                    37518,
                    78
                )
            ),
        ];
        yield [
            'invalid_parameters.lbl',
            self::createExpectedResult(),
        ];
        yield [
            'empty_label.lbl',
            self::createExpectedResult(),
        ];
    }

    private static function createExpectedResult(...$encodedImageDataResults): EncodedImageDataCollection
    {
        $collection = new EncodedImageDataCollection();

        foreach ($encodedImageDataResults as $encodedImageDataResult) {
            $collection->add($encodedImageDataResult);
        }

        return $collection;
    }

    private static function createEncodedImageData(
        string $data,
        int    $imageDataLength,
        int    $imageRowLength
    ): EncodedImageData
    {
        return new EncodedImageData(
            $data,
            $imageDataLength,
            $imageRowLength
        );
    }
}
